  BACKGROUND: 'background',
  TITLE: 'title',
  OVERLAYS: 'overlays',
  CORNER_TOP_LEFT: 'cornerTopLeft',
  CORNER_TOP_RIGHT: 'cornerTopRight',
  CORNER_BOTTOM_LEFT: 'cornerBottomLeft',
  CORNER_BOTTOM_RIGHT: 'cornerBottomRight'
